function render_cart(){let template=$("[data-cart-item-template]").html();let items=[];if(items.count>0){$(".aio_mini_cart_wrap").removeClass("dn").html("");$("[data-empty-cart]").addClass("dn");$.each(items,function(a,b){let item=template.replaceAll("{{title}}","Product title").replaceAll("{{params}}","Product params").replaceAll("{{quantity}}",1).replaceAll("{{price}}","250 AED").replaceAll("{{url}}","").replaceAll("{{image}}","https://placehold.it/100");$(".aio_mini_cart_wrap").append(item)})}else{$(".aio_mini_cart_wrap").addClass("dn");$("[data-empty-cart]").removeClass("dn")}};